const Header = (props) => {
  return (
    <div className="flex h-screen justify-between  bg-white p-4 dark:bg-black">
      <h1 className="font-mono text-3xl uppercase text-black dark:text-white">
        <span className="text-bold text-red-600">Crypto </span>Calculator
      </h1>
      <div className="flex">
      <h1 className="2xl py-2 uppercase text-black dark:text-white">
        {props.account}
      </h1>
      <button onClick={props.onClick} className="dark:text-white w-[40px] ml-8">
        <img className="w-6" src="/images/logout.png" />
      </button>
      </div>
    </div>
  );
};

export default Header;

